prompt Creating TRAILS...
create table TRAILS
(
  trail_name       VARCHAR2(255) not null,
  trail_id         NUMBER(6) not null,
  difficulty_level VARCHAR2(50) not null,
  location         VARCHAR2(255) not null,
  price            FLOAT not null,
  open_closed      VARCHAR2(10) not null,
  trail_rating     NUMBER not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table TRAILS
  add primary key (TRAIL_ID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );

